                        html:           "    <link rel=\"stylesheet\" href=\"css/markdown.css\" />\n    <link rel=\"stylesheet\" href=\"index.css\" />\n    <script type=\"application/javascript\" src=\"3rdparty/ace/ace.js\"></script>\n    <script type=\"application/javascript\" src=\"3rdparty/marked.js\"></script>\n    <script type=\"application/javascript\" src=\"3rdparty/FileSaver.js\"></script>\n    <script type=\"application/javascript\" src=\"3rdparty/jszip.js\"></script>\n    <script type=\"application/javascript\" src=\"3rdparty/aja.js\"></script>\n    <script type=\"application/javascript\" src=\"views/controls/editorControl.js\"></script>\n    <script type=\"application/javascript\" src=\"views/controls/markdownControl.js\"></script>\n    <nav class=\"navbar navbar-default\">\n        <div class=\"navbar-header\">\n            <a class=\"navbar-brand\"><span class=\"glyphicon glyphicon-cog\" aria-hidden=\"true\"></span> AtomicJS</a>\n            <ul class=\"nav navbar-nav\">\n                <li id=\"btnRun\"><a id=\"runButton\"><span class=\"glyphicon glyphicon-play\" aria-hidden=\"true\"></span> Run</a></li>\n            </ul>\n        </div>\n\n        <!-- Collect the nav links, forms, and other content for toggling -->\n        <div class=\"collapse navbar-collapse\" id=\"toolbar\">\n            \n        </div><!-- /.navbar-collapse -->\n    </nav>\n    <div id=\"sidebar\" class=\"sidebar\">\n        <div class=\"sidebar-panel panel-group\" id=\"accordion\" role=\"tablist\" aria-multiselectable=\"true\">\n            <div class=\"panel panel-default\">\n                <div class=\"panel-collapse collapse in\">\n                    <div class=\"panel-body\">\n                        <div class=\"checkbox\"><input id=\"livePreviewCheckbox\" type=\"checkbox\" /><label for=\"livePreviewCheckbox\">Live preview</label></div>\n                        <br>\n                        <div class=\"dropdown\">\n                            <label for=\"editorThemeList\">Editor Theme: </label><select id=\"editorThemeList\" size=\"1\" ><optgroup label=\"Bright\"><option value=\"ace/theme/chrome\">Chrome</option><option value=\"ace/theme/clouds\">Clouds</option><option value=\"ace/theme/crimson_editor\">Crimson Editor</option><option value=\"ace/theme/dawn\">Dawn</option><option value=\"ace/theme/dreamweaver\">Dreamweaver</option><option value=\"ace/theme/eclipse\">Eclipse</option><option value=\"ace/theme/github\">GitHub</option><option value=\"ace/theme/iplastic\">IPlastic</option><option value=\"ace/theme/solarized_light\">Solarized Light</option><option value=\"ace/theme/textmate\">TextMate</option><option value=\"ace/theme/tomorrow\">Tomorrow</option><option value=\"ace/theme/xcode\">XCode</option><option value=\"ace/theme/kuroir\">Kuroir</option><option value=\"ace/theme/katzenmilch\">KatzenMilch</option><option value=\"ace/theme/sqlserver\">SQL Server</option></optgroup><optgroup label=\"Dark\"><option value=\"ace/theme/ambiance\">Ambiance</option><option value=\"ace/theme/chaos\">Chaos</option><option value=\"ace/theme/clouds_midnight\">Clouds Midnight</option><option value=\"ace/theme/cobalt\">Cobalt</option><option value=\"ace/theme/gruvbox\">Gruvbox</option><option value=\"ace/theme/gob\">Green on Black</option><option value=\"ace/theme/idle_fingers\">idle Fingers</option><option value=\"ace/theme/kr_theme\">krTheme</option><option value=\"ace/theme/merbivore\">Merbivore</option><option value=\"ace/theme/merbivore_soft\">Merbivore Soft</option><option value=\"ace/theme/mono_industrial\">Mono Industrial</option><option value=\"ace/theme/monokai\">Monokai</option><option value=\"ace/theme/pastel_on_dark\">Pastel on dark</option><option value=\"ace/theme/solarized_dark\">Solarized Dark</option><option value=\"ace/theme/terminal\">Terminal</option><option value=\"ace/theme/tomorrow_night\">Tomorrow Night</option><option value=\"ace/theme/tomorrow_night_blue\">Tomorrow Night Blue</option><option value=\"ace/theme/tomorrow_night_bright\">Tomorrow Night Bright</option><option value=\"ace/theme/tomorrow_night_eighties\">Tomorrow Night 80s</option><option value=\"ace/theme/twilight\">Twilight</option><option value=\"ace/theme/vibrant_ink\">Vibrant Ink</option></optgroup></select>\n                        </div>\n                        <br>\n                        <div class=\"dropdown\">\n                            <label for=\"exampleList\">Playgrounds: </label><select id=\"exampleList\"></select>\n                        </div>\n                        <br>\n                        <br>\n                        <div class=\"btn-group\">\n                            <input id=\"addNewPlaygroundButton\" type=\"button\" value=\"Add New Playground\" />\n                        </div>\n                        <br>\n                        <br>\n                        <div class=\"btn-group\">\n                            <input id=\"savePlaygroundsButton\" type=\"button\" value=\"Save Environment\" />\n                        </div>\n                        <br>\n                        <div class=\"btn-group\">\n                            <input id=\"resetPlaygroundsButton\" type=\"button\" value=\"Reset Environment\" />\n                        </div>\n                        <div class=\"btn-group\">\n                            <input id=\"exportCurrentPlaygroundButton\" type=\"button\" value=\"Export Current Playground\" />\n                            <input id=\"downloadCurrentPlaygroundButton\" type=\"button\" value=\"Download Current Playground\" />\n                        </div>\n                        <div class=\"btn-group\">\n                            <input id=\"importPlaygroundButton\" type=\"button\" value=\"Import New Playground\" />\n                        </div>\n                        <br>\n                        <div class=\"checkbox\"><input id=\"displayEditorsCheckbox\" type=\"checkbox\" /><label for=\"displayEditorsCheckbox\">Display Editors</label></div>\n                        <br>\n                        <br>\n                        <div class=\"checkbox\"><input id=\"viewEngineModelCheckbox\" type=\"checkbox\" /><label for=\"viewEngineModelCheckbox\">View Engine Model</label></div>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <button id=\"toggleSideBar\" class=\"toggleSideBar\"><span class=\"collapse\">&lt;<br>&lt;<br>&lt;</span><span class=\"expand\">&gt;<br>&gt;<br>&gt;</span></button>\n    </div>\n    <div id=\"playground\" class=\"playground\">\n        <div class=\"editors\">\n            <div id=\"description\" class=\"playgroundDescription markdownContainer\"></div>\n            <div class=\"editorSet\">\n                <div class=\"top\">\n                    <div class=\"editorContainer\">\n                        <div id=\"htmlEditor\"></div>\n                        <span class=\"containerLabel\">HTML</span>\n                    </div>\n                </div>\n                <div class=\"middle\">\n                    <div class=\"editorContainer\">\n                        <div id=\"cssEditor\"></div>\n                        <span class=\"containerLabel\">CSS</span>\n                    </div>\n                </div>\n                <div class=\"bottom\">\n                    <div class=\"editorContainer\">\n                        <div id=\"javascriptEditor\"></div>\n                        <span class=\"containerLabel\">Javascript</span>\n                    </div>\n                </div>\n            </div>\n            <div class=\"previewSet\">\n                <div class=\"all\">\n                    <div class=\"editorContainer\">\n                        <div id=\"preview\" class=\"preview\"></div>\n                        <span class=\"containerLabel\">Preview</span>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div id=\"engineFooter\" class=\"footer\">\n            Playground Engine Model:\n            <div class=\"editorContainer2 editor\">\n                <pre>\n<code id=\"model\" class=\"language-javascript\"></code>\n                </pre>\n            </div>\n        </div>\n    </div>\n    <div id=\"editorControl\" class=\"editor\"></div>\n    <div id=\"markdownControl\" class=\"markdown-body\"></div>\n"
